Magadheera (2009)

Director:S.S. Rajamouli
Writers:Vijayendra Prasad &amp; S.S. Rajamouli  
Release Date:30 July 2009  
Genre:Action/Drama/Romance
Plot:
When Harsha a Bike Stunter from Vishakapatnam accidentally meets Indhu 
discovers his warrior life KALABHAIRAV in his last birth, the remaining 
story portrays how Indhu and Kalabhairava are connected.
